import React, { Component } from 'react';
import Head from '../components/Head';

export default class Classes extends Component {
	render() {
		return (
			<div>
				<Head />
				<div id="body">
					<table>
						<thead>
							<tr>
								<td>name</td>
								<td>password</td>
								<td>\'class\'</td>
							</tr>
						</thead>
						<tbody>
							
							</tbody>
					</table>
				</div>
			</div>
		);
	}
}
